"""A Busca em Profundidade segue um caminho até o final antes de explorar os outros.

Passos do algoritmo
1. Criar uma pilha para armazenar os nós a serem visitados.
2. Iniciar a busca pelo nó inicial.
3. Explorar um caminho até o final antes de voltar.
4. Continuar até encontrar o objetivo ou visitar todos os nós.
![image.png](data:image/png;base64,)

# Busca em Profundidade (DFS)
"""

def dfs(grafo, inicio, objetivo):

    pilha = [inicio]  #pilha para armazenar os nós a serem explorados
    visitados = set()

    while pilha:
        no = pilha.pop() #Ultimo no da pilha
        print(f"Visitando: {no}")

        if no == objetivo:
            print("Objetivo encontrado!")
            return True

        visitados.add(no)

        # Pegamos os vizinhos do nó atual e invertemos a ordem. O motivo da inversão é garantir que os nós sejam visitados na ordem esperada
        for vizinho in reversed(grafo.get(no, [])):
            if vizinho not in visitados:
                pilha.append(vizinho)  # Adicionamos o vizinho à pilha para ser explorado depois

    print("Objetivo não encontrado!")
    return False

grafo = {
    'A': ['B', 'C'],
    'B': ['D', 'E'],
    'C': ['F'],
    'D': [],
    'E': [],
    'F': []
}

dfs(grafo, 'A', 'E')

