"""# Busca de Custo Uniforme (UCS)

A Busca de Custo Uniforme expande o nó com menor custo acumulado primeiro.

Passos do algoritmo
1. Criar uma fila de prioridade para armazenar os nós a serem visitados, ordenada pelo custo.
2. Iniciar a busca pelo nó inicial.
3. Expandir o nó com menor custo acumulado.
4. Continuar até encontrar o objetivo.



![image.png](data:image/png;base64,)
"""

import heapq

numeros = [5, 3, 9, 1, 4] # o menor valor vai para a frente. Todo pai é menor que os filhos, criando um min-heap válido.

heapq.heapify(numeros)
print(numeros)

