import heapq

grafo_custo = {
    'A': [('B', 1), ('C', 4)],  # "O nó A se conecta a B (custo 1) e C (custo 4)"
    'B': [('D', 1), ('E', 2)],  # "B se conecta a D (custo 1) e E (custo 2)"
    'C': [('F', 3)],            # "C se conecta a F (custo 3)"
    'D': [],  # "D não tem vizinhos"
    'E': [],  # "E não tem vizinhos"
    'F': []   # "F não tem vizinhos"
}

def ucs(grafo, inicio, objetivo):

    fila = [(0, inicio)]  # "A fila de prioridade começa com o nó inicial e custo 0"
    visitados = {}  # "Dicionário para armazenar o menor custo até cada nó"

    while fila:
        custo, no = heapq.heappop(fila)  # "Pega o nó com menor custo acumulado"

        if no in visitados and visitados[no] <= custo:
            continue

        print(f"Visitando: {no} com custo {custo}")
        visitados[no] = custo  # "Registramos o menor custo encontrado para o nó"

        if no == objetivo:
            print("Objetivo encontrado!")
            return True

        for vizinho, custo_vizinho in grafo.get(no, []):
            heapq.heappush(fila, (custo + custo_vizinho, vizinho))
            # "Adicionamos os vizinhos à fila com o custo atualizado"

    print("Objetivo não encontrado!")
    return False


ucs(grafo_custo, 'A', 'E')

